from typing import List


class Solution:
    def wiggleSort(self, nums: List[int]) -> None:
        """
        Do not return anything, modify nums in-place instead.
        """
        # length of the input array
        n = len(nums)
        # index of the median element
        k = (n + 1) // 2

        def partition(l, r):
            # choose the last element as the pivot
            pivot = nums[r]
            # initialize the left pointer to the beginning of the array
            i = l
            # iterate over the array from left to right
            for j in range(l, r):
                # if the current element is less than or equal to the pivot,
                # swap it with the leftmost element greater than the pivot
                if nums[j] <= pivot:
                    nums[i], nums[j] = nums[j], nums[i]
                    i += 1
            # swap the pivot with the leftmost element greater than the pivot
            nums[i], nums[r] = nums[r], nums[i]
            # return the index of the pivot after partitioning the array
            return i

        def quickSelect(l, r):
            # if there is only one element in the array, return it
            if l == r:
                return nums[l]
            # partition the array and get the index of the pivot
            pivot_index = partition(l, r)
            # if the index of the pivot is the same as k, return the pivot
            if k == pivot_index:
                return nums[k]
            # if k is less than the index of the pivot, recurse on the left half of the array
            elif k < pivot_index:
                return quickSelect(l, pivot_index - 1)
            # if k is greater than the index of the pivot, recurse on the right half of the array
            else:
                return quickSelect(pivot_index + 1, r)

        # find the median of the array using Quick Select
        median = quickSelect(0, n - 1)

        # initialize the pointers i and k to the beginning and end of the array, respectively
        i, j, k = 0, 0, n - 1
        # iterate over the array using the pointer j
        while j <= k:
            # if the current element is less than the median, swap it with the leftmost
            # element greater than the median and advance the left pointer
            if nums[j] < median:
                nums[i], nums[j] = nums[j], nums[i]
                i += 1
                j += 1
            # if the current element is greater than the median, swap it with the rightmost
            # element less than the median and advance the right pointer
            elif nums[j] > median:
                nums[j], nums[k] = nums[k], nums[j]
                k -= 1
            # if the current element is equal to the median, just advance the pointer
            else:
                j += 1

        # reverse the elements in the less than and greater than partitions
        # and interleave them to obtain the desired result
        mid = (n + 1) // 2
        nums[::2], nums[1::2] = nums[:mid][::-1], nums[mid:][::-1]


